(657, '_transient_wc_kco_addons', 'O:8:\"stdClass\":2:{s:5:\"start\";a:2:{i:0;O:8:\"stdClass\":4:{s:9:\"plugin_id\";s:3:\"kco\";s:5:\"class\";s:11:\"start-block\";s:5:\"title\";s:34:\"Welcome to the Klarna Add-ons page\";s:7:\"content\";s:592:\"<p>Klarna Add-ons are additional, optional extensions to support your Klarna product. More Klarna related info will be added over time so make sure to keep an eye on this page.</p><hr/><h3 class=\"checkout-addons-subheading\">Klarna Shipping</h3><p>Klarna Shipping Service is a dynamic way of presenting shipping options. It helps you increase conversion and customer satisfaction at the point of purchase by making the selection of logistics products user friendly and efficient.</p><p>Activate this feature in your <a href=\"{{klarna-settings-page-url}}\">Klarna Checkout settings page</a>.</p>\";}i:1;O:8:\"stdClass\":4:{s:9:\"plugin_id\";s:15:\"klarna_payments\";s:5:\"class\";s:11:\"start-block\";s:5:\"title\";s:34:\"Welcome to the Klarna Add-ons page\";s:7:\"content\";s:180:\"<p>Klarna Add-ons are additional, optional extensions to support your Klarna product. More Klarna related info will be added over time so make sure to keep an eye on this page.</p>\";}}s:8:\"sections\";a:1:{i:0;O:8:\"stdClass\":5:{s:9:\"plugin_id\";s:4:\"both\";s:5:\"class\";s:22:\"klarna-checkout-addons\";s:5:\"title\";s:16:\"Available addons\";s:11:\"description\";s:0:\"\";s:5:\"items\";a:3:{i:0;O:8:\"stdClass\":9:{s:5:\"class\";s:39:\"klarna-order-management-for-woocommerce\";s:4:\"href\";s:0:\"\";s:5:\"title\";s:23:\"Klarna Order Management\";s:5:\"image\";s:96:\"https://s3-eu-west-1.amazonaws.com/krokedil-checkout-addons/images/kco/klarna-icon-thumbnail.jpg\";s:11:\"description\";s:165:\"Handle post purchase order management in Klarna\'s system directly from WooCommerce. This way you can save time and don\'t have to work in both systems simultaneously.\";s:6:\"button\";s:10:\"Learn more\";s:11:\"plugin_slug\";s:83:\"klarna-order-management-for-woocomme